import request from '@/utils/request'

export function getUserList(params) {
  return request({
    url: '/api/adminuser/userList',
    method: 'get',
    params
  })
}

export function postAddAdminUser(params) {
  return request({
    url: '/api/adminuser/register',
    method: 'post',
    data: params
  })
}
